Josey Baker Bread: 54 Recipes
ISBN : 978J1452113685
Publisher : Chronicle Books
Imprint : Chronicle Books
Publication date : April 2014

Twelve bread 'lessons' from the classic country loaf, to the fundamentals of bread baking: sourdough, slashing, rising, freeform loaves. Forty additional recipes explore other varieties of bread (seeded, whole grain, pizzas, pocketbreads) and baking projects (coffee cake, cookies).
